INSERT INTO `comment` VALUES ('LOVE THIS GAME','I love this game!','Super Smash Bros',1),('I hate this game!','It sucks bro!','Super Smash Bros',3),('Its an okay game','I enjoyed it','Donkey Kong 64',6),('I hate it','I hate it','addCommentTest',10),('I like donkey Kong','This is a good game','Donkey Kong 64',11),('don\'t like this game','It really could be better','Call of Duty: Modern Warfare',33),('This is a great game!','I hope they continue to update this game in the future!','Call of Duty: Modern Warfare',34),('Honestly could be better','I really don\'t like this game but I\'ll play it anyways','Call of Duty: Modern Warfare',35),('I like this game!','Cool game!','Call of Duty: Modern Warfare',37);
